    }
    document.getElementById("form").value = ""
  }
  return (
    <AppContainer backgroundColor="black">
      <Button backgroundColor="pink">Click This Button</Button>
      {/* <Form todos={todos} addToDo={addToDo}/>
      {todos.map(todo => <h1>{todo}</h1>)} */}
    </AppContainer>
  );
}

export default App;
